        let beach = this.props.beach
        console.log("beach", beach)
        if(beach.length > 0){
            return   
            <div>
            <img id="userbeachphoto" 
                src={beach.photo_1}
                alt="no_image_yet">
                </img> 
            </div>
        }else{
            retuern <span>loading
        }



        return (
            <div>

            </div>
        )
    }
}
